import React,{useState} from 'react';
import styeld from 'styled-components';


const Button=styeld.img`
  width:24px;
  height:24px;
  float:right;
  margin-top:20px;
  margin-right: 100px;
`
function Main() {
  const [modal,setModal]=useState(false)
  function onNewPost(){
    setModal(true)
  }
  return (
      <Button onClick={onNewPost} src='images/newPost/newPost_normal.png'/>
  );
}

export default Main;
